import React from 'react';
import { Routes, Navigate, Route, Link } from "react-router-dom";
import NavBar from './NavBar.jsx';


class App extends React.Component {
  constructor(props){
    super(props);
    this.state = {};
  }

  render(){
    return(
      <div id="app-container">
        <>
          <NavBar/>
          <Routes>
            <Redirect exact from="/" to="/home"/>



          </Routes>
        </>
      </div>
    )
  }
}

export default App;
